import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {BrowserRouter} from "react-router-dom"

import Tables from './components/Table';

ReactDOM.render(
  <BrowserRouter>
  <App />
  <Tables/>
  </BrowserRouter>,
  document.getElementById('root')
);
